//===============================================
$lProcess = new GProcess();
$lProcess-&gt;run("test", "string");
//===============================================
// GProcess.php
//===============================================
class GProcess {
    //===============================================
    public function __construct() {
        
    }
    //===============================================
    public function run($_module, $_method) {
        if($_module == "test") {
            $this-&gt;runTest($_module, $_method);
        }
    }
    //===============================================
