</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-wampserver_autorisation-des-machines-virtuelles" href="#utilisation-de-wampserver">Autorisation des machines virtuelles</a>
</h2><br>Autorisation des machines virtuelles:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
# C:\wamp64\bin\apache\apache2.4.54.2\conf\httpd.conf
#================================================
LoadModule vhost_alias_module modules/mod_vhost_alias.so
#================================================
Include conf/extra/httpd-vhosts.conf
#================================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-wampserver_configuration-du-port-du-serveur-web" href="#utilisation-de-wampserver">Configuration du port du serveur web</a>
</h2><br>Configuration du port du serveur web:<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
# C:\wamp64\bin\apache\apache2.4.54.2\conf\httpd.conf
#================================================
Listen 0.0.0.0:9052
Listen [::0]:9052
#================================================</pre>&nbsp;<br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-wampserver_configuration-du-repertoire-racine-du-serveur-web" href="#utilisation-de-wampserver">Configuration du répertoire racine du serveur web</a>
</h2><br>Configuration du répertoire racine du serveur web:<br><br><pre class="GCode1 Code1 AceCode" data-mode="sh" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">#================================================
# C:\wamp64\bin\apache\apache2.4.54.2\conf\extra\httpd-vhosts.conf
#================================================
&lt;VirtualHost *:9052&gt;
    ServerName readyphp.ovh
    ServerAlias www.readyphp.ovh 
    ServerAdmin tiakagerard@hotmail.com
    DocumentRoot "C:/ready_php/src/"

    &lt;Directory "C:/ready_php/src/"&gt;
        Options All
        AllowOverride All
        Order allow,deny
        allow from all
        Require all granted
    &lt;/Directory&gt;
&lt;/VirtualHost&gt;
#================================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-wampserver_recherche-des-erreurs-de-demarrage" href="#utilisation-de-wampserver">Recherche des erreurs de démarrage</a>
