:: Terminal
::===============================================
cd C:\wamp64\bin\apache\apache2.4.54.2\bin
httpd -t
::===============================================</pre><br>En cas d'erreurs:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br><h2 class="GTitle1 Title1">
